INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 2834, 40, 20063115, 1, "青空の下で謁見", 2, 8, "フリーマーケット会場", 7, 91002, "ペコリーヌとの出会い", 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 2835, 40, 20063115, 1, "未来の騎空団\nマスコット？", 2, 8, "フリーマーケット会場", 7, 91002, "マホとの出会い", 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 2837, 40, 20063115, 1, "お嬢さまからの\n緊急依頼", 2, 8, "ランドソル市街地", 7, 91002, "アキノとの出会い", 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 4108402, 40, 20063115, 1, "黄金色の悩みごと", 2, 8, "フリーマーケット会場", 18, 91002, "ジュンとの出会い", 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 4107402, 40, 20063115, 1, "白熱！　格闘大会！", 2, 8, "フリーマーケット会場", 18, 91002, "カオリとの出会い", 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (1, 9000227, 40, 20063115, 1, "祭り太鼓はオーエドの華", 2, 8, "オーエド町", 16, 91002, "ニノンとの出会い", 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 2101181, 40, 20063115, 1, "人気者は遅れて\nやってくる", 3, 8, "フリーマーケット会場", 19, 91002, "スズナとの出会い", 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 4109402, 40, 20063115, 1, "巫女・ミーツ・魔法少女", 3, 8, "ランドソル市街地", 18, 91002, "ナナカとの出会い", 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 4305402, 40, 20063115, 1, "ネズ耳は二度なくなる", 3, 8, "フリーマーケット会場", 18, 91002, "キャル＆コッコロとの出会い", 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 4101402, 40, 20063115, 1, "この出会いにカンパイ！", 3, 8, "ランドソル市街地", 18, 91002, "ユカリとの出会い", 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 4106402, 40, 20063115, 1, "陰陽アンサンブル", 3, 8, "ランドソル市街地", 18, 91002, "アオイとの出会い", 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (1, 2836, 40, 20063115, 1, "運試し十番勝負！", 3, 8, "フリーマーケット会場", 7, 91002, "シノブとの出会い", 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 10118);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 0, 0, 20063115, 0, "彼女たちの新たな日常", 1, 0, 0, 0, 0, "オープニング", 5118600, 0, 10118);
